import { Button, StyleSheet, Text, TextInput, View } from "react-native";

const SmartScreen = () => {
  return (
    <View style={styles.screen}>
      <Text>The Game Start</Text>
      <View>
          <Text>SELECT A NUMBER</Text>
          <TextInput/>
          <View>
              <Button title="RESET"/>
              <Button title="SUBMIT"/>
          </View>
      </View>
    </View>
  );
};

export default SmartScreen;
